class Flags:
    """flags """

    def __init__(self, rawflags=0):
        self.rawflags = rawflags
        # setup flags
        self.is_normal = (rawflags >> 0) & 1
        self.is_ping = (rawflags >> 1) & 1
        self.unk = (rawflags >> 2) & 1
        self.is_encrypted = (rawflags >> 3) & 1
        self.is_compressed = (rawflags >> 4) & 1
        self.app_session_id = (rawflags >> 4) & 0xF # Unique for each server restart? Unique throughout client session.
        self.sender_id = (rawflags >> 24) & 0xFF # Sender ID (Server=13; EventServer=14; Client=9)



