class Gunz2Packet:

    def __init__(self, data=None):
        # unpack packet header
        if data is not None:
            self.data = data
            self.rawheader = data[:20]
            self.rawflags, self.size, self.unk1, self.counter, self.pid, self.checksum = struct.unpack(
                "IIIIHH", data[:20])
            self.flags = Flags(self.rawflags)

            self.pid_name = parselog.get_packetname(self.pid)

    def get_senddata(self):
        pdata = self.data[20:]

        if self.flags.is_compressed:
            pdata = zlib.compress(pdata)

        if self.flags.is_encrypted:
            pdata = packet_crypt.encrypt(pdata)

        rdata = self.data[:20] + pdata

        return rdata

       # print ("flags:{0:b}, size:{1}, unk:{2:X}, count:{3}, pID:{4:X}, pname:{5}, checksum:{6:X}".format(self.rawflags, self.size, self.unk1, self.counter, self.pID, self.pID_name, self.checksum))


